import React, { useState } from 'react';
import { AgChartsReact } from 'ag-charts-react';
import './visibility-chart.css';
// Chart Component
const Visibility = ({ data }) => {
    const data_parse = data.list.slice(0, 8);

    const chartData = data_parse.map((item) => ({
      time: Number(item.dt_txt.slice(11,13)),
      visibility: item.visibility,
    }));

    const [chartOptions, setChartOptions] = useState({
      title: { text: "Visibility" , position: 'bottom'},
      data: chartData,
      series: [{ type: 'line', xKey: 'time', yKey: 'visibility' }],
      axes: [{ type: 'ordinal', position: 'bottom', tick: { count: 8 } }, { type: 'number', position: 'right' }],
    });

    return <AgChartsReact className='vis' options={chartOptions}></AgChartsReact>;
  };

export default Visibility;
